const axios = require('axios')

const Index = () => {

  const getMovies = (e) => {
    e.preventDefault()

    axios.get('http://www.omdbapi.com/?apikey=cda2a2d3&i=tt3896198')
      .then(res => console.log(res))
      .catch(err => console.log(err))
  }

  return (
    <div>
      <h4>Movie Database Search</h4>
      <input type="text" />
      <button onClick={getMovies}>Search Movies</button>
    </div>
  )
}

export default Index
